import React from 'react';

class NavBar extends React.Component{

render(){
    return(
        <nav>
		<div>		  
		    <img src="" alt="Logo Principal" width="40" height="40" style="margin-top: 10px; margin-left: 10px; margin-right: 10px"/>
		 
		    <a href="img/isologo.png">PELICULAS DIGITALES</a>
		  
            <ul id="nav-mobile" class="right hide-on-med-and-down">
                <li><a href="#">Iniciar Sesion</a></li>
                <li><a href="#">Mis Peliculas</a></li>
                <li><a href="#">Lista de Deseos</a></li>			
                <li><a href="#">Carrito</a></li>			
                <li><a href="#">Buscar Peliculas</a></li>						
            </ul>
		</div>
	</nav>
    )
}
}

export default NavBar;
